// machine definition


********************************************************/

////////////////// setup machine_states ///////////////////////
/*
 * the states of all machines on the page, a object whose keys
 * are the ids (a randomly generated string) of the machines,
 * and whose value is an object.
 */

var machine_states = {};

// does the URL have a states object?
var qs = document.URL.split('?')[1];
if (typeof qs != 'undefined') {
    machine_states = $.deparam(qs);
	console.log('we already haz some machines: ', machine_states);
}


// does the states object have a state for this particular machine?
if (typeof machine_states[machine.id] == 'undefined') {
    console.log('but we dont have this machine');
    // setup new state machine
    machine_states[machine.id] = {
        state: machine.start_state,
        params: {}
    };

	// "soft" redirect to url with this state in it
    history.pushState({}, 'da name', '?'+$.param(machine_states));
};

// assign state now that we def have one
console.log('machine_states, $.param(states)', machine_states, $.param(machine_states));
console.log('history', history.state);



window.onpopstate = function(e, o) {
    console.log('onpopstate ', e, o);
}



// show debugger status pane thingy if show_status == true
if (typeof show_status != 'undefined' && show_status === true) {
    w.find('.status').html(widget('fsm:machine_status'));
}

// state change listener
w.bind('state_change', function(e, o) {
    var state_id = o.state_id;
    var params = o.params;
    console.log('FSM: Transition to '+state_id);

    // check this is a existing state
    if (typeof machine.states[state_id] == 'undefined') {
        w.trigger('invalid_state_change', { state_id: state_id });
        return;
    }

    // make sure this machine has a .interface element in the interface_widget child widget
    if (w.find('.interface').length != 1) {
        console.warn('FSM:  no element .interface for state '+state_id, w.find('.interface'));
        w.trigger('machine_error', { message: "No element with class of .interface found." });
        return false;
    }


    // change the state
    console.log('FSM: Changing to state '+state_id);

    // update machine_states
    machine_states[machine.id] = {
        state: state_id,
        params: params
    };

    // switch to the state's widget
    w.find('.interface').html(machine.states[state_id].f());

    // update history
    history.pushState({}, 'da name 2', '?'+$.param(machine_states));
});

// add our interface pane, passing in callback to fire the start state when finished.

console.log('FSM: Firing up machine in state ', machine_states[machine.id]);
var start_widget = machine.states[machine_states[machine.id].state].f();
w.find('.interface_container').html(machine.interface_widget(start_widget));

