.{{= name }} {
    background-color: #777;
    width: 500px;
    color: black;
    font-size: 50%;
    clear: both;
}

.{{= name }} li.error {
    color: red;
}

// state machine
var machine = {
    id: 'MAIN_MACHINE',
    states: {
        home: {
            // widget
            f: function() { return widget('gtr:home'); },
            // permitted transitions
            t: ['allegate','respond','browse','search']
        },
        allegate: {
            f: function() { return widget('gtr:allegate'); },
            t: ['home']
        },
        allegations: {
            f: function() { return widget('gtr:allegations'); }
        },
        person: {
            f: function() { return widget('gtr:person'); }
        },
        search: {
            f: function() { return widget('gtr:search'); }
        },
        about: {
            f: function() { return widget('gtr:about'); }
        }
    },
    start_state: 'home',
    // interface widgets must contain a .interface element, where state widgets ^^ will be plonked
    interface_widget: function(content) { return widget('gtr:main_tmpl', { content: content }) }
};

var w = $("#"+id);

console.log('FSM: Starting new state machine: ', machine);

// master state variable
var current_state = machine.start_state;

// show debugger status pane thingy if show_status == true
if (typeof show_status != 'undefined' && show_status === true) {
    w.find('.status').html(widget('fsm:machine_status'));
}

// state change listener
w.bind('state_change', function(e,o) {
    var state = o.state;

    console.log('FSM: Transition to '+state);

    // check this is a existing state
    if (typeof machine.states[state] == 'undefined') {
        w.trigger('invalid_state_change', { state: state });
        return;
    }

    // make sure this machine has a .interface element in the interface_widget child widget
    if (w.find('.interface').length != 1) {
        console.warn('FSM:  no element .interface for state '+state, w.find('.interface'));
        w.trigger('machine_error', { message: "No element with class of .interface found." });
    } else {
        console.log('FSM: Changing to state '+state);
	    w.find('.interface').html(machine.states[state].f());
    }
});

// add our interface pane, passing in callback to fire the start state when finished.
var start_widget = machine.states[machine.start_state].f();
w.find('.interface_container').html(machine.interface_widget(start_widget));

var w = $("#"+id);

post_message('FSM DEBUGGER INITIALIZED');

w.closest('.machine').bind('state_change', function(e,o) {
	post_message('State changed to '+o.state);
});

function post_message(message) {
    w.append('<li>'+message+'</li>');
}

var w = $("#"+id);

post_message('FSM DEBUGGER INITIALIZED');

w.closest('.machine').bind('state_change', function(e,o) {
	post_message('State changed to '+o.state_id);
});

w.closest('.machine').bind('invalid_state_change', function(e,o) {
    post_error('No such state as '+o.state_id);
});

w.closest('.machine').bind('machine_error', function(e,o) {
    post_error(o.message);
});


